  false,\n\t\"url\": null,\n\t\"notes\": \"A series of forest study plots was established
  to determine the effects of cutting on various cover types. This summary report
  for Moosehorn National Wildlife Refuge outlines Refuge accomplishments during the
  1930's to 1970's. The report begins by summarizing the habitat conditions and food
  and cover conditions during the period. Habitat management for woodcock is covered.
  Resource management is outlined; topics include timber removal. A progress report
  on field investigations and applied research is also provided.\",\n\t\"owner_org\":
